package bank.bank.Beans;import java.io.Serializable;import java.util.List;public class AreaList implements Serializable{	private static final long serialVersionUID = 1851963449L;	private List<SubAreaList> subAreaList;	private String img;	private String selectedImg;	private String name;	public List<SubAreaList> getSubAreaList() {		return this.subAreaList;	}	public void setSubAreaList(List<SubAreaList> subAreaList) {		this.subAreaList = subAreaList;	}	public String getImg() {		return this.img;	}	public void setImg(String img) {		this.img = img;	}	public String getSelectedImg() {		return this.selectedImg;	}	public void setSelectedImg(String selectedImg) {		this.selectedImg = selectedImg;	}	public String getName() {		return this.name;	}	public void setName(String name) {		this.name = name;	}	public AreaList() {}	public AreaList(List<SubAreaList> subAreaList, String img, String selectedImg, String name){		super();		this.subAreaList = subAreaList;		this.img = img;		this.selectedImg = selectedImg;		this.name = name;	}	public String toString() {		return "AreaList [subAreaList = " + subAreaList + ", img = " + img + ", selectedImg = " + selectedImg + ", name = " + name + "]";	}}